- input: "TEXT\x1CC00448696\x1C1\x1C\x1CF3XA\x1CAll contributions noted as EM indicate
    a contribution received by the Senate Conservatives Fund that was earmarked for
    a specific candidate. The candidate name is noted and the date of transmittal
    to each candidate is noted.  The matching transmittal checks are itemized on line
    23.  All contributors aggregating over $200 calendar year to date with incomplete
    employer/occupation have received requests for additional information.  Per instructions
    from the FEC, the adjusting entry on line 21b balances the IE payments made to
    Senate Conservatives Fund for CC Processing Fees.  As directed by the FEC, the
    memo entries to Senate Conservatives Fund on Schedule E are not debt owed by the
    committee, but to disclose use of the SCF email list as there is no direct cost
    to SCF.  This report is amended to correct a disbursement made to Omniprint that
    was originally disclosed as an operating expense but was actually an independent
    expenditure made for Marlin Stuzman.  The expense was reported as made to Allegiance
    Direct on a 48-hour notice filed on 4/30/10.  However, the actual vendor was OmniPrint.
    \ This expense has been properly disclosed on this amendment.\n"
